var tipuesearch = {"pages": [{'title': 'About', 'text': '設計二甲 王銘楫 \n 倉儲: cad2020 \n 小組網站 \n 小組倉儲 \n -------------------------------------------- \n 第二組 \n Repository: \xa0 40723153 \xa0 | Site: \xa0 40723153 Repository: \xa0 40723225 \xa0 | Site: \xa0 40723225 Repository: \xa0 40823109 \xa0 | Site: \xa0 40823109 Repository: \xa0 40823110 \xa0 | Site: \xa0 40823110 Repository: \xa0 40823111 \xa0 | Site: \xa0 40823111 Repository: \xa0 40823117 \xa0 | Site: \xa0 40823117 Repository: \xa0 40823118 \xa0 | Site: \xa0 40823118 Repository: \xa0 40823123 \xa0 | Site: \xa0 40823123 Repository: \xa0 40823126 \xa0 | Site: \xa0 40823126 Repository: \xa0 40823139 \xa0 | Site: \xa0 40823139 Repository: \xa0 40823144 \xa0 | Site: \xa0 40823144 Repository: \xa0 40823153 \xa0 | Site: \xa0 40823153 Repository: \xa0 40871106 \xa0 | Site: \xa0 40871106 \n \n -------------------------------------------- \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'content', 'text': '', 'tags': '', 'url': 'content.html'}, {'title': '工程師', 'text': 'task:請閱讀文章並進行翻譯 \n Engineering(工程師) \n Engineers, as practitioners of engineering, are professionals who invent, design, analyze, build and test machines, complex systems, structures, gadgets and materials to fulfill functional objectives and requirements while considering the limitations imposed by practicality, regulation, safety and cost.  工程師，身為工程方面的實踐者，他們開發、設計、分析、建構並且測試機器、複雜系統、結構與機件和資料的專業人員，以實現功能目標和要求，同時考慮實用性、法規、安全性和成本的限制。 \n The word engineer (Latin ingeniator) is derived from the Latin words ingeniare ("to create, generate, contrive, devise") and ingenium ("cleverness"). The foundational qualifications of an engineer typically include a four-year bachelor\'s degree in an engineering discipline, or in some jurisdictions, a master\'s degree in an engineering discipline plus four to six years of peer-reviewed professional practice (culminating in a project report or thesis) and passage of engineering board examinations.  單詞engineer（拉丁語ingeniator）源自於拉丁語單詞ingeniare（“創造、產生、設計、設計”）和ingenium（“聰明”）。工程師的通常擁有工程學術方面四年的學士學位，或在工程學科的碩士學位加上四到六年的同行評審專業實踐（最終形成項目報告或論文）和通過工程委員會考試。 \n The work of engineers forms the link between scientific discoveries and their subsequent applications to human and business needs and quality of life. \n 工程師的工作建立了科學探索與人類、商業、生活品質之間的連結 \n', 'tags': '', 'url': '工程師.html'}, {'title': 'Pyslvs', 'text': 'Pyslvs為一款以python編寫，用來模擬連桿機構的程式 \n 以下為簡易教學 \n ------------------------------------------------------- \n 點擊右鍵，有add與add ground 兩種 \n add為新增link point(連桿節點) \n \n add groud為增加固定軸 \n \n 按住左鍵，框選point後，右鍵點擊New Link可將其連接 \n \n 在Inputs介面中，點擊base point中做為轉動原點的point，再選擇Drive point中作為驅動的point， 最後於 Variables選擇後按開始鈕即可模擬 \n \n', 'tags': '', 'url': 'Pyslvs.html'}, {'title': 'CoppeliaSim', 'text': '', 'tags': '', 'url': 'CoppeliaSim.html'}, {'title': '影音教學', 'text': '影片教學分為上下兩集，上集主要是功能與介面的介紹，下集為動態屬性的說明 \n \n', 'tags': '', 'url': '影音教學.html'}, {'title': '碰撞', 'text': '當Body is respondable開啟時，物體會開啟碰撞響應 當格子與格子有交集時，則物體會產生碰撞 若兩者沒有交集，則不會碰到 \n \n \n \n Global respondable mask與 Local\xa0 respondable mask的差異 \n 當物體沒有在同一個父集合下，global respondable mask全部關閉則不與場景中的物件產生碰撞。 主要是因為是Local\xa0 respondable mask是處理有相互關係物件 的碰撞，而Global respondable的碰撞是對於場景的所有objects碰撞的控制。若物件是互相接合的，當產生干涉時可利用Local\xa0 respondable mask採取空集合的方式消除，並且在global respondable mask開啟的請況下，物體只會取消父集合下互相有關係之物件的碰撞，其餘如球體等等依然可以接觸到，而不會直接穿過! \n 1.的情況為AB有交集，而2.的情況C為D與E的父集合，三者關係為層遞的結構 \n \n 此處即常見的父集合形式 \n \n', 'tags': '', 'url': '碰撞.html'}, {'title': '網頁建立', 'text': 'step1. \n Download\xa0 fall2020_cp.7 \xa0至隨身碟 \n \n step2. \n Download\xa0 Portable GIT. \xa0至fall2020/data 目錄下 \n \n \n step3. \n 建立倉儲 \n \n step4. \n 編譯start.bat的路徑 \n \n \n step5. \n 至倉儲取得URL，並且git clone 下內容 \n \n \n step6. \n 使用git submodule取得cmsimde \n \n \n step7. \n 將cmsimde/up_dir目錄下的檔案拉到外層 \n \n step8. \n 用pip載入所需套件 \n \n \n step8. \n 用wsgi.py 測試網頁編輯 \n \n \n \n final step.\xa0 \n 將資料git push至倉儲即完成 \n \n \n', 'tags': '', 'url': '網頁建立.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'Dartpad', 'text': '\n', 'tags': '', 'url': 'Dartpad.html'}, {'title': 'task1', 'text': 'task:使用繪圖軟體繪製零件，並比較其體積 \n \n \n \n', 'tags': '', 'url': 'task1.html'}, {'title': 'task2', 'text': 'task:紀錄零件繪製過程，供組員學習參考 \n Inventor版本:2020 \n 檔案: 雲端硬碟 \n 第一題 \n \n \n 第二題 \n \n 第三題 \n \n 第四題 \n \n 第五題 \n \n 第六題 \n \n 第七題 \n \n 第八題 \n \n 第九題 \n \n 第十題 \n \n 第十一題 \n \n 第十二題 \n \n \n \n', 'tags': '', 'url': 'task2.html'}, {'title': 'ssh', 'text': '為什麼要使用SSH? \n 不使用SSH時，在git push至倉儲必須輸入密碼，然而，在公開場所輸入密碼顯然是件高風險的事! \n 因此，藉由在本地跟遠端倉儲存入密鑰，在git push時即可藉由密鑰做身分認證，不必在每次推送時，還需要輸入密碼，大大減少曝光風險。 \n \n 如何使用SSH? \n step1. \n 進入shell環境 \n \n \n step2. \n 使用以下指令創建key \n ssh-keygen -t rsa -b 4096 -C "使用者學號" \n \n 並確定是否成功創建 \n \n \n \n step3. \n 利用Putty中的 puttygen.exe 將id_rsa解讀成private key \n \n \n step4. \n 進入倉儲頁面，點選setting，進入SSH & GPG keys中點選New SSH key,將public key存入遠端倉儲 \n \n \n \n step5. \n 編譯start.bat，加入以下 \n \n \n set GIT_HOME=%Disk%:\\portablegit\\bin\\\nset GIT_SSH=%Disk%:\\putty\\plink.exe \n \n step6. \n 編譯.git下的config，使其變為SSH認證 \n \n [core]\n\xa0\xa0\xa0\xa0repositoryformatversion = 0\n\xa0\xa0\xa0\xa0filemode = false\n\xa0\xa0\xa0\xa0bare = false\n\xa0\xa0\xa0\xa0logallrefupdates = true\n\xa0\xa0\xa0\xa0symlinks = false\n\xa0\xa0\xa0\xa0ignorecase = true\n[submodule]\n\xa0\xa0\xa0\xa0active = .\n[remote "origin"]\n\xa0\xa0\xa0\xa0#url = https://github.com/mdecourse/cad2020.git\n\xa0\xa0\xa0\xa0url = git@github.com:mdecourse/cad2020.git\n\xa0\xa0\xa0\xa0fetch = +refs/heads/*:refs/remotes/origin/*\n[branch "master"]\n\xa0\xa0\xa0\xa0remote = origin\n\xa0\xa0\xa0\xa0merge = refs/heads/master\n[submodule "cmsimde"]\n\xa0\xa0\xa0\xa0url = https://github.com/mdecourse/cmsimde.git \n \n final step \n 進入 putty.exe，將本地的private key做login \n \n \n *完成後請測試推送，成功使用SSH推送後，倉儲的SSH頁面的鑰匙會變成綠色的，並在下方顯示推送日期 \n', 'tags': '', 'url': 'ssh.html'}, {'title': '正版、盜版與版本的影響', 'text': '在工程界裡常見的一大弊病就是使用盜版軟體，而這造成了什麼影響? \n 盜版軟體所存取的檔案在正版軟體中可能無法解析，試想做了一個月的project到了客戶的手中，  當客戶打開檔案時，竟然檔案無法做解析，此時花費一個月的成果等於白費!  然而在modify時發現全公司上下竟然使用的都是盜版軟體，於是無法快速的輸出可行的版本。  又抑或是公司購入的版本過舊，使客戶端依然無法解析檔案等等。  以上皆是工程界中不願意使用正版軟體與使用新版本所產生的重大問題。 \n', 'tags': '', 'url': '正版、盜版與版本的影響.html'}, {'title': 'API', 'text': 'API(Application Programming Interface\xa0)直譯為應用程式介面，但以中文來看，似乎不太好理解。 \n 以下舉例說明 \n 當你口渴時想喝飲料，找了個自動販賣機投了25元，點了12號按鈕，從出口拿了罐紅茶。  但是，自動販賣機不像人類一樣，可以直接跟他說:我要12號的紅茶。 \n 那怎麼讓機器明白我要做什麼? \n 此時按鈕就成了與機器溝通的橋梁，而按鈕的概念就如同API!  使機器與機器、程式與程式間明白我需要做的事，這就是API的概念。 \n \xa0 \n', 'tags': '', 'url': 'API.html'}, {'title': 'Project', 'text': '', 'tags': '', 'url': 'Project.html'}, {'title': '修改', 'text': '', 'tags': '', 'url': '修改.html'}, {'title': '首次更正', 'text': '第一次修改 \n \n 1.此處缺口過大，容易造成鋼球掉落 \n 改善方案:將後方軌道延伸 \n \n \n 2.平台於抬升處設計不良，使鋼球容易卡住 改善方案:將平台加厚，避免抬升時產生的空間將球夾住 \n \n \n \n 3.大軌道的寬度過大與未增加斜度，導致鋼球無法確實的每次抵達下方軌道 \n 改善方案:軌道縮減、增加斜度 \n \n \n 4.S型軌道的設計造成鋼球容易掉落 \n 改善方案:將軌道傾斜角度加大或是加深軌道 \n \n \n 5.進入S形軌道前的小軌道傾斜角度不足，導致鋼球無法確實進入軌道 \n \n \n 6.進入軌道處同樣需為斜面，鋼球才可依循軌道落下 \n 改善方案:軌道改為斜面 \n \n 以上圖片說明可至實際模擬影片更為清楚: 連結', 'tags': '', 'url': '首次更正.html'}, {'title': '二次更正', 'text': '此部分首次修改時未增加斜度，導致鋼球經由S軌道進入軌道時鋼球無法順利運動 \n \n 平台增加擋板避免抬升時鋼球夾住 \n \n 首次修改時斜面未設計好，導致鋼球無法確實進入軌道中 \n \n S形軌道深度加深 \n \n \n', 'tags': '', 'url': '二次更正.html'}, {'title': '創建與過程', 'text': '各週開會內容請至小組網頁觀看: click \n 初次開會結果統整: \n \n 目標:設計一鋼球循環機構 \n \n 第二次開會結果統整: \n \n 分組:小組內各自研究過於沒效率，因此將其分為三組 \n 機構組:負責機構的發想、尺寸與干涉 程式組:負責學習coppeliasim之模擬 畫圖組:將機構組所構思的草圖實際畫出 \n \n \n 第三次開會結果統整: \n \n 重新建構分組學習模式:機構已大部分構思完畢，但是程式組在學習程式使用的成效不佳。 主要原因為網路上的學習資源過於分散且零碎，因此調整程式組學習模式。 更正方面: 直接實行程式模擬，當產生問題時，程式組全員解決當前問題，以必免每個人學習的資料 重複或是學習的資料根本用不到，而造成不必要的時間浪費。 \n \n 第四次開會結果統整: \n \n 程式模擬已完成，但在機構設計上有不足之處，造成鋼球無法循環 \n \n 第五次開會結果統整: \n \n 機構設計已提出該善方案，並且嘗試增加複雜的機構 \n \n 第六次開會結果統整: \n \n 已成功建構設計目標，但機構的放置與干涉等問題尚未解決 \n \n 第七次開會結果統整: \n \n 小組網頁整合 \n 新機構因時間不夠，而選擇放棄，選擇採用當前機構 \n 機構最終版模擬已完成 \n \n \n \n \n \n \n', 'tags': '', 'url': '創建與過程.html'}, {'title': '成品', 'text': '\n 完整檔案請至影片說明欄下載 \n', 'tags': '', 'url': '成品.html'}]};